'''''-më''''' is the feminine equivalent of the masculine ending ''[[-mo]]''. This ending appears to be rare, perhaps because it is easily confused with the nominal ending ''[[-me|-më]]''.
==Examples==
* '''sermë''' = "(female) friend" ('''ser-''' = "to love, to be found of (of liking, friendship)"; [[SER]])
